import "./App.css";
import P5Wrapper from "react-p5-wrapper";
import p5 from "p5";

function App() {
  const sketch = (p5) => {
    p5.setup = () => {
      p5.createCanvas(300, 300);
    };
    p5.draw = () => {
      p5.background(20);

      p5.fill(250, 0, 0);
      p5.rect(100, 150, 50, 20, 20, 50);
    };
  };

  return <P5Wrapper sketch={sketch} />;
}

export default App;
